import React from 'react'
import Frame from '../img/candidates/img.png'
import Candidate from '../pages/Candidates'

const Candid = (props) => {
  return (
    <div>
        <img src={Candidate}></img>
        <div className='title'>{props.candidate.name}</div>
    </div>
  )
}

export default Candid
